import React from 'react';

function User({user}) {
  return (
  <div>
   <b>{user.username}</b><span>({user.email})</span>
  </div>
  )
}

function UserList () {
  const users = [
    {
      id: 1,
      username: 'rkdud',
      email:'hap@ss',
      active: true,
    },
    {
      id: 2,
      username: 'kyuha',
      email:'pro@nn',
      active: false,
    },
    {
      id: 3,
      username: 'kiki',
      email:'love@dd',
      active: false,
    }
  ]

  return (
    <div>
      {
        users.map(user => {
          <User user={user}/>
        })
      }
    </div>
  )

}

export default UserList;
